        const response = await fetch(url, {
            method: "GET",
            headers: {
                Authorization: `token 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`
            }
        });
        const data = await response.json();

        const url2 = `https://api.github.com/search/issues?q=repo:nationwide-building-society/nbs-github-terraform+is:pr+closed:${this.props.start}..${this.props.end}&per_page=100`;
        const response2 = await fetch(url2, {
            method: "GET",
            headers: {
                Authorization: `token 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`
            }
        });
        const data2 = await response2.json();
        this.setState({createdData: data, closedData: data2, loading :false})

        console.log(data);
        console.log(data2);
    }

    render() {
        return (
            <div>
                {this.state.loading || !this.state.data || !this.state.data2 ? <div>loading...</div> : <div>{this.state.createdData} {this.state.closedData}</div>}
            </div>
        )
    }
}
